import { useEffect, useState } from 'react';

const PostFetch = () => {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/posts')
            .then(res => {
                return res.json();
            })
            .then(resdata => {
                setPosts(resdata);
            })
    }, [])


return (
    <div>
        <p>[</p>
        {posts && posts.map((post) => (
            <div key={post.id}>
                <pre>   &#123;</pre>
                <pre>       "userId": {post.userId},</pre>
                <pre>       "id": {post.id},</pre>
                <pre>       "title": {post.title},</pre>
                <pre>       "body": {post.body.replace("\n", "")}</pre>
                <pre>   &#125;,</pre>
            </div>
        ))}
        <p>]</p>
    </div>
);
}

export default PostFetch;
